import React from 'react'
import './Button.css'

const Button = {
    GrayHoverButton: function GrayHoverButton(props) {
        return (
            <button className='GrayHoverButton' onClick={props.onClick}>{props.text}</button>
        )
    },
    GreenHoverButton: function GreenHoverButton(props) {
        return (
            <button className='GreenHoverButton' onClick={props.onClick}>{props.text}</button>
        )
    },
    GreenHoverLinkButton: function GreenHoverLinkButton(props) {
        return (
            <button className='GrayHoverButton' onClick={props.onClick}>
                <Link to={props.to} >
                    {props.text}
                </Link>
            </button>
        )
    },
    GreenHoverLinkButton: function GreenHoverLinkButton(props) {
        return (
            <button className='GreenHoverButton' onClick={props.onClick}>
                <Link to={props.to} >
                    {props.text}
                </Link>
            </button>
        )
    }
}

export default Button
